webpackJsonp([2140],{"./node_modules/json-loader/index.js!./.cache/json/articles-bootstrap-bootstrap-panels.json":function(a,e){a.exports={data:{markdownRemark:{html:'<h2>Bootstrap Panels</h2>\n<p>The Bootstrap framework provides you with a feature called panels. A panel is a box that has a styled heading and then a body that allows you to display information in an organized manner, through a set of one or more panels.</p>\n<h4>How To Use:</h4>\n<p>To use Bootstrap Panels you add a <code>&#x3C;div></code> with a class for your type of panel (class <code>panel panel-default</code> or something similar, see the panel examples for more information.) and then two nested <code>&#x3C;div></code> tags, one for the heading (class <code>panel panel-heading</code>) and one for the body (class <code>panel panel-body</code>). You may find that the Code Example is easier to understand than a written explanation.</p>\n<p><strong>Code Example</strong></p>\n<pre><code>&#x3C;div class="panel panel-primary">\n  &#x3C;div class="panel panel-heading">Panel Primary&#x3C;/div>\n  &#x3C;div class="panel panel-body"> This is a panel with the primary panel style.&#x3C;/div>\n&#x3C;/div>\n</code></pre>\n<h4>Panel Examples:</h4>\n<p>This is a set of examples that shows each type of panel. The CSS Class is displayed above each example.</p>\n<p><code>panel panel-default</code></p>\n<div class="panel panel-default">\n<div class="panel panel-heading">Panel Default</div>\n<div class="panel panel-body"> This is a panel with the default panel style.</div>\n</div>\n<p><code>panel panel-primary</code></p>\n<div class="panel panel-primary">\n<div class="panel panel-heading">Panel Primary</div>\n<div class="panel panel-body"> This is a panel with the primary panel style.</div>\n</div>\n<p><code>panel panel-success</code></p>\n<div class="panel panel-success">\n<div class="panel panel-heading">Panel Success</div>\n<div class="panel panel-body"> This is a panel with the success panel style.</div>\n</div>\n<p><code>panel panel-info</code></p>\n<div class="panel panel-info">\n<div class="panel panel-heading">Panel Info</div>\n<div class="panel panel-body"> This is a panel with the info panel style.</div>\n</div>\n<p><code>panel panel-warning</code></p>\n<div class="panel panel-warning">\n<div class="panel panel-heading">Panel Warning</div>\n<div class="panel panel-body"> This is a panel with the warning panel style.</div>\n</div>\n<p><code>panel panel-danger</code></p>\n<div class="panel panel-danger">\n<div class="panel panel-heading">Panel Danger</div>\n<div class="panel panel-body"> This is a panel with the danger panel style.</div>\n</div>',frontmatter:{title:"Bootstrap Panels",parent:"/home/stuart/guides/src/pages/articles/bootstrap/bootstrap-panels/index.md absPath of file"}}},pathContext:{slug:"/articles/bootstrap/bootstrap-panels/"}}}});
